import styled from "styled-components";


export const HeaderBlock = styled.div`
    width: 100%;
    height: 10vh;  
    background-color:skyblue;
`;

export const HeaderSection = styled.div`
  width: 100%;
  height: 5vh;
  position: relative;
`;
export const HeaderSectionText = styled.div`
  display:inline-block;
  text-align: center;
  padding-left:20%;

`;
